INSERT INTO `deskripsi_umum` (`ID_DESKRIPSI_UMUM`, `DESKRIPSI_UMUM`) VALUES
(1, 'Salah satu sumber energi yang bisa diperbarui adalah Jarak Pagar. Jatropha curcas L yang dapat diproses menjadi biodiesel. Pengembangan Jarak Pagar diharapkan akan membuka kesempatan kerja, menumbuhkan agro-industri di pedesaan, meningkatkan pemanfaatan lahan-lahan kosong yang akan meningkatkan pendapatan petani serta mengurangi emisi karbon monoksida (Kyoto-protocol).\r\nPengembangan Jarak Pagar tentu harus didukung oleh ketersediaan bahan tanaman berkualitas. Hasil seleksi rekuren pada populasi IP2-A di Asembagus, Situbondo, Jawa Timur, dengan standar produksi 500 kapsul/tanaman/tahun pada tahun-I, telah menhasilkan IP3-A dengan perkiraan produktivitas 2,2-2,5 ton biji kering/ha pada tahun-I.\r\nPada kondisi hujan yang optimal (1200-1500 mm/tahun) serta ketersediaan hara cukup, populasi IP3-A mampu menghasilkan 5-6 ton/ha pada tahun-III atau 8-9 ton/ha pada tahun-IV sampai tanaman berumur 30 tahun. kandungan minyak berkisar 33-36% yang bervariasi menurut musim panen. Tanaman dapat dipanen dua kali dalam setahun; tanaman sangat rentan di daerah kering dengan curah hujan kurang dari 500 mm/tahun atau daerah basah dengan curah hujan diatas 2500 mm/tahun. Tanaman Jarak Pagar yang sedang berbunga sangat sensitif terhadap hujan berintensitas tinggi\r\n'),
(2, 'Sebagai negara produsen tekstil No. 5 di dunia, volume ekspor industri tekstil dan produk tekstil (TPT) Indonesia pada tahun 2005 mencapai US$8,59 miliar dan mampu menyerap tenaga kerja mencapai 1,7 juta orang, belum termasuk tenaga kerja yang diserap dalam sektor pertanian dan perdagangan. Serat kapas merupakan bahan baku utama dari industri TPT. Kebutuhan akan serat kapas pada 2004/2005 berkisar 510 ribu ton yang diprediksi akan meningkat menjadi 688 ribu ton pada 2010. Produksi serat kapas dalam negeri hanya berkisar 1,600â€“2,500 ribu ton atau kurang dari 0,5% kebutuhan nasional. Sampai dengan tahun 2025, agribisnis kapas diharapkan dapat memberikan kontribusi pada industri TPT sekitar 30% dari kebutuhan bahan baku kapas saat ini. Tantangan yang dihadapi oleh pengembangan kapas In-donesia cukup kompleks, berawal dari ketidaktersediaan benih bermutu sampai dengan kelangkaan modal petani. Ketersediaan sumber daya alam terutama lahan kering masih cukup luas di luar Jawa, seperti Sulawesi Selatan, Nusa Tenggara Barat, dan Nusa Tenggara Timur yang memberikan peluang bagi pengembangan kapas nasional. Oleh karena itu, komoditas kapas merupakan salah satu komoditas yang diprioritaskan untuk dikembangkan dalam mendukung revitalisasi perkebunan. \r\nSalah satu aspek intensifikasi adalah varietas unggul, karena varietas unggul merupakan komponen teknologi yang paling mudah diadopsi oleh petani. Balittas telah melepas 15 seri varietas Kapas Indonesia (Kanesia); enam diantaranya dilepas pada tahun 2006/2007 yaitu Kanesia 10, Kanesia 11, Kanesia 12, Kanesia 13, Kanesia 14, dan Kanesia 15. Kanesia 8 merupakan varietas unggul kapas yang telah digunakan dalam pengembangan kapas nasional dengan potensi produksi 1,85â€“2,73 ton kapas berbiji/ha dan persen serat 33,3â€“38,7%. Varietas-varietas baru tersebut memiliki potensi produksi 17â€“22% lebih tinggi dibanding Kanesia 8, dan tingkat ketahanan yang moderat terhadap salah satu hama utama kapas, Amrasca biguttulla, serta mutu serat yang tidak berbeda dengan Kanesia 8. Kanesia 14 dan Kanesia 15 memiliki daya adaptasi yang lebih besar terhadap keterbatasan air dibandingkan varietas-varietas lainnya, sehing-ga kedua varietas tersebut lebih sesuai untuk dikembangkan pada daerah-daerah tadah hujan. \r\nPenggunaan varietas-varietas unggul kapas dalam pengembangan dengan luas areal yang diperkirakan mencapai 10.000 hektar dan dengan produktivitas pada tingkat petani mencapai 1,5 ton/ha (50â€“70% dari potensi produksi), maka produksi kapas nasional akan meningkat 9.000 ton kapas berbiji atau 3.000 ton serat kapas yang setara dengan US$4,2 juta (dengan harga serat rata-rata US$1,4/kg serat). Manfaat tersebut akan meningkat lebih tinggi apabila luas areal kapas mampu mencapai target pengembangan kapas nasional yaitu sekitar 70.000 ha pada 2010.'),
(3, 'Sejak tahun 1928 sampai sekarang Indonesia masih merupakan negara pengekspor kapuk, tetapi jumlahnya terus menurun. Pada 1936/1937 Indonesia merupakan negara pengekspor terbesar di dunia, jumlahnya mencapai 28.400 ton serat atau sekitar 85% kebutuhan serat kapuk dunia. Pada tahun 2003 ekspor serat kapuk menurun menjadi 1.496 ton serat. Penurunan ekspor kapuk antara lain disebabkan banyaknya kapuk tua yang tidak produktif, penebangan kapuk tanpa diimbangi peremajaan, meningkatnya penggunaan serat kapuk dalam negeri, dan persaingan dengan bahan sintetis seperti karet busa. Selain itu penurunan ekspor kapuk Indonesia disebabkan kalah bersaing dalam harga dengan Thailand yang lebih murah. Untuk meningkatkan ekspor serat kapuk antara lain dengan meningkatkan produktivitas dan tetap mempertahankan kualitas serat kapuk yang baik. Varietas unggul yang telah dilepas Balittas untuk mendukung pengembangan kapuk ada-lah Muktiharjo 1 (MH 1) , Muktiharjo 2 (MH 2), dan Togo B dari tipe Karibea yang dilepas pada tahun 2006 dan sesuai untuk usaha tani monokultur, serta Muktiharjo 3 (MH 3) dan Muktiharjo 4 (MH 4) dari tipe yang sama yang sesuai untuk program penghijauan dan konservasi lahan yang dilepas pada tahun 2007.'),
(4, 'Kenaf (Hibiscus cannabinus L) sudah lama dibudidayakan di Indonesia dan pada tahun 1986/1987 mencapai luas 26.000 ha yang tersebar di Lampung, Jawa Barat, Jawa Tengah, Jawa Timur, dan Kalimantan Selatan. Kenaf memiliki keunggulan beradaptasi luas pada berbagai kondisi lahan dan memiliki toleransi yang tinggi terhadap kondisi cekaman abiotik seperti: genangan air, kekeringan, dan pH tanah yang rendah (masam). Kenaf merupakan tanaman hari pendek berumur 100â€“140 hari, dikembangkan dengan benih. \r\nHampir semua bagian tanaman dapat digunakan untuk bahan baku berbagai industri. Daun kenaf mengandung protein kasar 24% sangat baik untuk pakan ternak unggas dan ruminansia. Biji kenaf mengandung lemak 20% bagus untuk minyak goreng karena banyak mengandung asam lemak tidak jenuh (Oleat dan Linoleat). Kayu kenaf sangat baik sebagai bahan baku industri particle board untuk berbagai keperluan seperti furnitur, pintu, jendela, kusen, pelapis dinding rumah, dll. Serat kenaf banyak digunakan sebagai bahan baku berbagai industri seperti: fibre board, geo-textile, soil remediation, pulp dan kertas, tekstil, karpet, kerajinan tangan, dll. Fibre board dari serat kenaf saat ini digunakan sebagai bahan untuk interior mobil seperti langit-langit, pintu, dushboard, dll. Selain itu, fibre board juga banyak digunakan pada industri eletronik untuk casing TV, radio, tape, dll. Juga untuk perumahan sebagai pelapis dinding rumah, peredam suara, dll. Geotextile, fibredrain banyak digunakan oleh para kontraktor pada pembangunan bandara, jembatan, pertambangan, dll. sebagai ba-han untuk pencegahan longsornya tanah dan penyerapan air tanah. Soil remediation menggu-nakan serat kenaf adalah untuk memperbaiki kondisi kesuburan tanah terutama pada bekas pertambangan sebagai usaha reklamasi. Serat kenaf juga digunakan sebagai bahan suplemen dalam pembuatan tekstil yang diblending dengan serat kapas dan poliester. Pulp dari kenaf digunakan untuk industri kertas. \r\nPengembangan tanaman kenaf diprioritaskan pada lahan bonorowo (lahan banjir) yang tidak sesuai untuk tanaman lain pada waktu banjir. Dengan menyempitnya areal bonorowo (akibat dari perbaikan jaringan irigasi), tanaman kenaf mulai dikembangkan pada daerah lahan masam di daerah Kalimantan Timur dan lahan kering di Jawa. Pengembangan tanaman kenaf diprioritaskan pada lahan sawah irigasi terbatas dan lahan podsolik merah kuning (PMK). Kendala yang dihadapi untuk pengembangan komoditas tersebut adalah masih rendahnya produktivitas di tingkat petani, dan sulitnya proses penyeratan.\r\nVarietas unggul kenaf yang telah dihasilkan Balittas adalah KR 11 untuk lahan bonorowo; KR 14 dan KR 15 untuk lahan podsolik merah kuning (PMK); dan KR 9 dan KR 12 untuk lahan kering. Varietasâ€“varietas tersebut dapat ditanam sembarang waktu karena kurang terpengaruh oleh fotoperiodisitas. Pengembangan kenaf adalah di Jawa (Barat, Tengah, Timur), Lampung, Riau, Sulawesi Selatan, dan Kalimantan (Selatan, Timur, Tengah, dan Barat). \r\nPenggunaan varietas unggul kenaf dapat meningkatkan pendapatan petani hingga 25â€“ 35%. Selain itu, tanaman kenaf dapat digunakan untuk memberdayakan lahan kritis, seperti lahan masam (PMK dan gambut). Kenaf dapat ditanam secara tumpang sari dengan jagung lokal atau P7. Penggunaan varietas unggul kenaf di daerah yang berpotensi untuk pengembangan akan menghasilkan produksi 2â€“3 ton serat/tahun dan meningkatkan pendapatan petani sebesar Rp2.000.000,00 per musim.'),
(5, 'Rami semula dikembangkan di daerah dataran tinggi walaupun sebenarnya rami juga dapat dikembangkan di dataran rendah terutama yang memiliki fasilitas pengairan. Kendala pe-ngembangan rami adalah panjangnya rantai proses penyeratan sampai menjadi serat siap pintal. Proses yang panjang ini menyebabkan rami bukan sebagai â€œcash cropâ€, walaupun harga serat rami lebih tinggi dari harga serat kapas. Sebagai salah satu penghasil serat alami, rami merupakan komoditas yang perlu dikembangkan. Komoditas ini, selain menghasilkan serat alami yang bermutu tinggi, juga mempunyai hasil samping yang bernilai ekonomi, seperti kompos limbah dekortikasi dan daun rami untuk campuran pakan ternak. \r\nVarietas baru Ramindo 1, dengan nama lama Pujon 10, sudah sejak lama dikembangkan petani/pengusaha dan sudah terbukti keunggulannya baik di masyarakat maupun hasil penelitian. Ramindo 1 memberikan produktivitas serat yang tinggi (2â€“2,7 ton/ha/tahun) dengan kualitas serat yang cukup baik, serta memiliki daya adaptasi yang luas, sehingga klon ini sesuai untuk dikembangkan di dataran rendah, sedang hingga tinggi. \r\nLimbah dekortikasi (penyeratan) dapat diolah menjadi pupuk organik yang sangat halus dengan kandungan: Organik 20,13%; N total 2,15%; C/N ratio 3,01%; bahan organik 34,83%; P2O5 1,47%; K2O 2,76%; CaO 3,73%; MgO 2,22%; S 0,13%; dan KTK 65,56 me/100 g pupuk organik. Teknik pengomposan dapat dilakukan secara sederhana, yaitu dengan mencampurkan dedak, sedikit gula pasir, EM-4, dan disiram air secukupnya. Selain itu, sisa dekortikasi banyak mengandung kayu, dan seratnya baik untuk bahan baku pulp/kertas. \r\nDaun rami (40% dari bobot brangkasan segar) mengandung protein sekitar 24%, sangat baik untuk sumber protein ternak dan unggas. Setelah diproses menjadi tepung dapat dimanfaatkan untuk campuran konsentrat berbagai pakan ternak. Pakan ternak dari daun rami mengandung sekitar: 10% air; 1,05â€“1,75% lisin; 0,14â€“0,73% methionin; dan 0,18â€“0,31% triptophan. Selain itu mengandung karotin (provitamin A) dan riboflavin (vitamin B2) masing-masing 13,3 dan 0,74 mg tiap 100 g bahan keringnya. \r\nPenggunaan varietas unggul Ramindo 1 dengan pemberian paket pupuk lengkap (orga-nik, N, P, K dan ZPT+ PPC) dapat meningkatkan hasil serat sampai dengan 58â€“60%.'),
(6, 'Tebu merupakan komoditas utama yang dapat digunakan sebagai bahan baku gula. Dalam rangka pemenuhan kebutuhan gula nasional, akselerasi peningkatan produksi gula dirancang dalam tiga tahap pendekatan sasaran, yaitu:\r\n\r\n1. Kecukupan kebutuhan gula untuk konsumsi masyarakat (2006-2009),\r\n2. Terpenuhinya kebutuhan gula untuk konsumsi dan industri (2010-2014), dan\r\n3. Pengembangan produk samping berbasis bahan baku tebu (2015-2025).\r\n                                                              Untuk memperkuat pencapaian sasaran terpenuhinya kebutuhan untuk konsumsi dan industri, perlu implementasi program intensifikasi untuk meningkatkan produksi dan rendemen gula. Program ekstensifikasi pengembangan tebu membutuhkan areal seluas 430.000 hat dan hal ini perlu didukung dengan pemetaan areal dan varietas unggul yang sesuai\r\n\r\nTidak ada artikel di dalam kategori ini. Jika sub-kategori tampil di halaman ini, maka mungkin mengandung artikel-artikel.');

