(1, '1', 'IP-2A', 'Jatropha curcas L.', '2008', 'Penyemaian 1.5-2 bulan, mulai panen ±4 bulan setelah tanam, jumlah buah rata -rata 9 buah/tandan, jumlah tandan pada tahun pertama berkisar 45 tandan/pohon, jumlah total buah/pohon berkisar 400-450 buah, potensi produksi 1.9 ton/ha. Kandungan minyak is 34%, cocok untuk dikembangkan di dataran rendah dengan iklim kering.', 'Komersial', 'Balai Penelitian Tanaman Pemanis dan Serat', NULL, NULL, NULL);
