INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(1, 2, 'ISA 205A', 'ISA 205 A merupakan varietas introduksi berasal dari Institut de Recherches du coton et des Textiles Exotiques (IRCT) Perancis; menjadi koleksi plasma nurfah Balai Penelitian Tanaman Tembakau dan Serat (Balittas) pada tahun 1986.', '2003', NULL, NULL, '- 1977 kg kapas berbiji pada kondisi monokultur \r\n- 1341 kg kapas berbiji pada kondisi tumpangsari. ', '39.5% ', '- panjang 1.17 â€“ 1.25 inch, \r\n- kehalusan 4.2 â€“ 5.1 mic \r\n- kekuatan 22.0 â€“ 29.2 gr/tex \r\n- mulur 4.8-5.9 %. ', '- Toleran to A. biguttula. \r\n- Peka to S. rolfsii, R. solani, and X. campestris pv. Malvacearum', 'Komersial', 'S. Sumartini, Hasnam, F.T. Kadarwati, dan E. Sulistyowati', 'Balai Penelitian Tanaman Tembakau dan Serat\r\n\r\n', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(2, 2, 'Kanesia 8', 'KANESIA atau Kapas Indonesia adalah varietas unggul kapas hasil program pemuliaan tanaman kapas pada Balai Penelitian Tanaman Tembakau dan Serat. Perakitan varietas KANESIA ditujukan untuk memperbaiki produktivitas kapas baik pada usaha tani kapas monokultur maupun tumpang sari dengan palawija dan untuk memenuhi standar kualitas serat yang diinginkan oleh industri tekstil di Indonesia. Sampai dengan tahun 2006, telah dilepas 9 varietas baru seri KANESIA, yaitu Kanesia 1-9. Adapun varietas yang saat ini digunakan dalam pengembangan kapas adalah Kanesia 7, 8, dan 9.', '2003', '115 hari', NULL, '2545kg kapas berbiji ', '38.7% ', '- panjang 30.3 mm \r\n- kehalusan 4.1 mic \r\n- kekuatan 24.7 g/tex \r\n- keseragaman 84 %', '- Rentan terhadap H. Armigera\r\n- Agak tahan terhadap A. Biguttula dan X. campestris pv. Malvacearum\r\n- Tahan terhadap R. Solani dan S. Rolfsii.', 'Komersial', 'Hasnam, S. Sumartini, E. Sulistyowati, Abdurrakhman, Supriyono, Suhadi, F.T. Kadarwati, P.R. Riajaya, IGAA Indrayani, dan C. Suhara', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(3, 2, 'Kanesia 9', 'KANESIA atau Kapas Indonesia adalah varietas unggul kapas hasil program pemuliaan tanaman kapas pada Balai Penelitian Tanaman Tembakau dan Serat. Perakitan varietas KANESIA ditujukan untuk memperbaiki produktivitas kapas baik pada usaha tani kapas monokultur maupun tumpang sari dengan palawija dan untuk memenuhi standar kualitas serat yang diinginkan oleh industri tekstil di Indonesia. Sampai dengan tahun 2006, telah dilepas 9 varietas baru seri KANESIA, yaitu Kanesia 1-9. Adapun varietas yang saat ini digunakan dalam pengembangan kapas adalah Kanesia 7, 8, dan 9.', '2003', '112 hari', NULL, '2726 kg kapas berbiji ', '35.2% ', '- panjang 29.22 mm, \r\n- kehalusan 4.7 mic \r\n- kekuatan 22.6 gr/tex \r\n- keseragaman 83 %. ', '- Tahan terhadap R. solani dan S. Rolfsii\r\n- Rentan terhadap H. Armigera\r\n- Agak tahan terhadap A. biguttula dan X. campestris pv. Malvacearum.', 'Komersial', 'Hasnam, S. Sumartini, E. Sulistyowati, Abdurrakhman, Supriyono, Suhadi, F.T. Kadarwati, P.R. Riajaya, IGAA Indrayani, dan C. Suhara', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(4, 2, 'Kanesia 10', 'Kanesia 10 menunjukkan produktivitas yang lebih tinggi, memiliki potensi produksi lebih dari 3 ton kapas berbiji, juga beberapa keunggulan lain. Varietas Kanesia 10 menunjukkan indeks stabilitas Â± 1, yang artinya bahwa varietas ini mampu beradaptasi secara luas di berbagai areal pengembangan. Kemajuan yang cukup berarti dicapai pada kandungan serat pada varietas Kanesia 10. Kandungan seratnya 27,2% dan 8,11% lebih tinggi dibandingkan Kanesia 8. Karakteristik mutu serat Kanesia 10 sesuai dengan kebutuhan industri tekstil nasional yaitu panjang serat 26,92â€“29,34 mm, kekuatan 27,13â€“29,50 g/tex, dan keseragaman serat 83,3â€“84,6%. Walaupun demikian, kehalusan serat masih belum sepenuhnya memenuhi kriteria yang diharapkan oleh industri tekstil, yaitu 3,5-4,5 mic, walaupun beberapa pabrik masih menggunakan serat dengan kehalusan > 4,5 mic. Varietas Kanesia 10 sesuai untuk daerah Jatim, Jateng, NTB, Sulsel, DIY, Bali, dan NTT.', '2007', NULL, NULL, '- 1.969-3.025 kg/ha kapas berbiji dengan proteksi minimal (10g imidachloprit/kg benih dan pestisida ekstrak biji mimba) \r\n- 1.002-2.287 kg/ha kapas berbiji pada kondisi tanpa perlakuan insektisida ', '45.98% ', '- panjang 28.96 mm \r\n- kehalusan 4.38 mic \r\n- kekuatan 27.13 g/tex \r\n- Elastisitas 6.45% \r\n- keseragaman 83.7 %. ', '- Toleran terhadap A.biguttula, dan P. gossypiella', 'Sosialisasi kepada petani Permohonan hak PVT', 'E. Sulistyowati, Hasnam, S. Sumartini, H. Sudarmo, IGAA Indrayani, dan C. Suhara', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(5, 2, 'Kanesia 11', 'Kanesia 11 menunjukkan produktivitas yang lebih tinggi, yaitu memiliki potensi produksi lebih dari 3 ton kapas berbiji, juga beberapa keunggulan lain. Varietas ini menunjukkan indeks stabilitas Â± 1, yang artinya bahwa varietas Kanesia 11 mampu beradaptasi secara luas di berbagai areal pengembangan. Kemajuan yang cukup berarti dicapai pada kandungan serat pada varietas Kanesia 11. Kandungan seratÂ  varietas iniÂ  8,11% lebih tinggi diban-dingkan Kanesia 8. Karakteristik mutu seratÂ  Kanesia 11 sesuai dengan kebutuhan industri tekstil nasional yaitu panjang serat 26,92â€“29,34 mm, kekuatan 27,13â€“29,50 g/tex, dan keseragaman serat 83,3â€“84,6%. Walaupun demikian, kehalusan serat masih belum sepe-nuhnya memenuhi kriteria yang diharapkan oleh industri tekstil, yaitu 3,5-4,5 mic, walaupun beberapa pabrik masih menggunakan serat dengan kehalusan > 4,5 mic. Varietas Kanesia 11 sesuai untuk daerah Jatim, Jateng, NTB, Sulsel, DIY, Bali, dan NTT.', '2007', NULL, NULL, '- 1.960-3.027 kg/ha kapas berbiji dengan proteksi minimal (10g imidachloprit /kg benih dan pestisida ekstrak biji mimba) \r\n- 705-2.478 kg/ha kapas berbiji pada kondisi tanpa perlakuan insektisida ', '38.92% ', '- panjang 27.98 mm \r\n- kehalusan 4.5 mic \r\n- kekuatan 27.77 g/tex \r\n- Elastisitas 6.45% \r\n- keseragaman 83.3 %. ', '- Toleran terhadap A.biguttula \r\n\r\nVarietas ini direkomendasikan untuk pengembangan kapas tanpa pestisida.', 'Sosialisasi kepada petani', 'E. Sulistyowati, Hasnam, S. Sumartini, H. Sudarmo, IGAA Indrayani, dan C. Suhara', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(6, 2, 'Kanesia 12', 'Kanesia 12 menunjukkan produktivitas yang lebih tinggi, yaitu memiliki potensi produksi lebih dari 3 ton kapas berbiji, juga beberapa keunggulan lain. Varie-tas-varietas tersebut menunjukkan indeks stabilitas Â± 1, yang artinya bahwa varietas Kanesia 12 mampu beradaptasi secara luas di berbagai areal pengembangan. Varietas Kanesia 12 sesuai untuk daerah Jatim, Jateng, NTB, Sulsel, DIY, Bali, dan NTT.\r\n\r\n', '2007', NULL, NULL, '- 2,14-2,75 kg/ha kapas berbiji dengan proteksi minimal (10g imidachloprit /kg benih dan pestisida ekstrak biji mimba)\r\n- 1,35-2,65 kg/ha kapas berbiji pada kondisi tanpa perlakuan insektisida ', '34.54% ', '- panjang 29.34 mm\r\n- kehalusan 4.57 mic \r\n- kekuatan 29.50 g/tex \r\n- Elastisitas 6.07% \r\n- keseragaman 84.62 %. ', 'Toleran terhadap A.biguttula \r\n\r\nVarietas ini direkomendasikan untuk pengembangan kapas tanpa pestisida.', 'Sosialisasi kepada petani', 'E. Sulistyowati, Hasnam, S. Sumartini, H. Sudarmo, IGAA Indrayani, dan C. Suhara', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapas` (`ID_KAPAS`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPAS`, `DESKRIPSI_KAPAS`, `TAHUN_PELEPASAN`, `UMUM_PANEN`, `PRODUKTIVITAS`, `POTENSI_PRODUKSI`, `KANDUNGAN_SERAT`, `MUTU_SERAT`, `KETAHANAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(7, 2, 'Kanesia 13', 'Kanesia 13 menunjukkan produktivitas yang lebih tinggi , yaitu memiliki potensi produksi lebih dari 3 ton kapas berbiji, juga beberapa keunggulan lain. Kanesia 13 menunjukkan indeks stabilitas Â± 1, yang artinya varietas ini mampu beradaptasi secara luas di berbagai areal pengembangan. Kanesia 13 sesuai untuk daerah Jatim, Jateng, NTB, Sulsel, DIY, Bali, dan NTT.', '2007', NULL, NULL, '- 1.920-3.174 kg/ha kapas berbiji dengan proteksi minimal (10g imidachloprit /kg benih dan pestisida ekstrak biji mimba) \r\n- 995-2.135 kg/ha kapas berbiji pada kondisi tanpa perlakuan insektisida ', '36.42% ', '- panjang 26.92 mm\r\n- kehalusan 5.08 mic \r\n- kekuatan 28.32 g/tex \r\n- Elastisitas 6.83% \r\n- keseragaman 83.60 %. ', 'Toleran terhadap A.biguttula', 'Sosialisasi kepada petani Permohonan hak PVT', 'E. Sulistyowati, Hasnam, S. Sumartini, H. Sudarmo, IGAA Indrayani, dan C. Suhara<', 'Balai Penelitian Tanaman Tembakau dan Serat\r\n', );

