INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(2, 3, 'Muktihardjo 1 (MH 1)', 'Varietas kapuk hibrida MH 1 merupakan varietas hibrida hasil persilangan dua tipe kapuk yaitu tipe Indica dengan Karibea antara tiga tetua, yaitu (Randu Kuning x Bondowoso) x Congo atau disingkat (RKxBW)C. Varietas ini membentuk pohon-pohon yang tumbuh kuat, yang mempunyai sifat yang berbeda dengan induknya. Pohon tersebut lebih tahan terhadap kekeringan dibanding klon Jawa. Seratnya berwarna putih, tidak pecah di pohon, jumlah gelondong dan produksinya lebih banyak dibanding kapuk Jawa. Produksi varietas kapuk hibrida MH 1 pada umur 6 tahun, 12 tahun, dan 40 tahun masing-masing 427 gelondong/pohon, 1.038 gelon-dong/pohon, dan 2.881 gelondong/pohon Produktivitas pada umur 40 tahun tersebut mencapai 50.856 gelondong/ha, setara dengan 483 kg serat/ha atau 9,85 kg serat/pohon. ', '2007', 'Karibea ', '2.800 gelondong/pohon/tahun ', '5.28 kg/100 gelondong', '0,98 kg/100 Gelondong ', '27.77% ', 'putih mengkilat, panjang, grade AJK', 'Varietas ini kurang disukai benalu, dan Keadaan buah tidak pecah di pohon', 'Komersial', 'Moch. Sahid, Marjani, dan Hadi Sudarmo', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(3, 3, 'Muktihardjo 2 (MH 2)', 'Varietas kapuk hibrida MH 2 merupakan varietas kapuk hibrida hasil persilangan tiga te-tua yaitu (Ruezen Randu x Bondowoso) x Congo yang disingkat dengan (RRxBW)C. Varietas ka-puk hibrida MH 2 pada umur 6 tahun, 12 tahun, dan 40 tahun masing-masing produksinya 331 gelondong/pohon, 868 gelondong/pohon, dan 2.011 gelondong/pohon. Pohon yang telah ber-umur cukup lanjut yaitu lebih dari 40 tahun mampu menghasilkan 42.532 gelondong/ha atau 2.011 gelondong/pohon, setara dengan 335 kg serat/ha atau 6,84 kg serat/ pohon. Varietas ini membentuk pohon-pohon yang tumbuh kuat, yang mempunyai sifat yang berbeda dengan in-duknya. Pohon tersebut lebih tahan terhadap kekeringan dibanding klon Jawa. Seratnya ber-warna putih mengkilat, tidak pecah di pohon, jumlah gelondong dan produksinya lebih banyak dibanding kapuk Jawa.\r\n', '2007', 'Karibea', '2.500 gelondong/pohon/tahun.', '4,37 kg/100 gelondong.', '0,88 kg/100 gelondong.', NULL, ' putih mengkilat, panjang, grade AJK.', 'Buah/gelondong dari varietas ini tidak pecah di pohon, dan varietas ini kurang disukai benalu.', 'Komersial', 'Moch. Sahid, Marjani, dan Hadi Sudarmo', 'Balai Penelitian Tanaman Tembakau dan Serat\r\n', );
INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(5, 3, 'Muktihardjo 3 (MH 3)\r\n', 'Varietas kapuk hibrida MH 3 merupakan hasil persilangan antara klon Congo 2 (tipe Kari-bea) dengan klon lokal Lanang (tipe Indika). Klon Congo merupakan klon introduksi dari Congo, Afrika, yang produksinya mencapai 2.500 - 3.000 gelondong/pohon. Klon Lanang merupakan klon lokal yang mempunyai kelebihan warna serat putih mengkilat, tetapi produksinya rendah yaitu sekitar 750 gelondong/pohon. Varietas MH 3 produksinya dapat mencapai 2.400 gelon-dong/pohon yang lebih tinggi 18% - 20% dibanding MH 1 dan 27% - 30% dibanding MH2 yang sudah dilepas. Hasil seratnya berwarna putih mengkilat yang sangat disukai petani dan eksportir kare-na sesuai dengan kualitas Java Kapok. Pengembangannya disarankan secara okulasi karena, perkembangan melalui biji akan mengalami segrgasi.\r\n', '2007', 'Karibea ', '2.400 gelondong/pohon/tahun ', '4,54 kg/100 gelondong ', '21.47% ', '27.77% ', 'putih mengkilat \r\n', 'Hasil seratnya yang berwarna putih mengkilat dan sesuai dengan kualitas â€œJava Kapokâ€ ini sangat disukai petani dan eks', 'Komersial', 'Moch. Sahid, Bambang Heliyanto, dan Emy Sulistyowati', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(7, 3, 'Muktihardjo 4 (MH 4)\r\n', 'Varietas kapuk MH 4 merupakan hasil persilangan antara klon Seluwok Sawangan 29 (SS 29) yang merupakan klon lokal (tipe Indika), dengan klon Congo (C, tipe Karibea) merupakan klon introduksi dari Congo, Afrika, yang produksinya mencapai 2.500-3.000 gelondong/pohon, tetapi warna serat abu-abu kecokelatan. Klon SS 29 mempunyai kelebihan warna serat putih mengkilat, tetapi produksinya rendah yaitu sekitar 600-750 gelondong/pohon. MH 4 produksi-nya dapat mencapai 2.200 gelondong/pohon, lebih tinggi 11â€“13 % dibanding MH 1 dan 18%-25% dibanding MH 2. Hasil seratnya berwarna putih mengkilat yang sangat disukai petani dan eksportir, karena sesuai dengan kualitas â€œJava Kapok.', '2007', 'Karibea ', '2.200 gelondong/pohon/tahun ', '4,98 kg/100 gelondong ', '20.96% ', '27.70% ', 'putih mengkilat \r\n', 'Hasil seratnya yang berwarna putih mengkilat dan sesuai dengan kualitas â€œJava Kapok ini sangat disukai petani dan eks', 'Komersial', 'Moch. Sahid, Bambang Heliyanto, dan Emy Sulistyowati', 'Balai Penelitian Tanaman Tembakau dan Serat', );
INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(8, 3, 'Togo B', 'Varietas Togo B merupakan hasil seleksi dari varietas introduksi Togo yang berasal dari Togo di Afrika. Varietas ini menunjukkan potensi hasil gelondong yang tinggi dengan jumlah gelondong 41.428 gelondong/ha atau 2.551 gelondong/pohon pada umur 40 tahun. Ketika masih muda (12 tahun), varietas ini sudah mampu menghasilkan 845 gelondong/pohon. Serat yang dihasilkan oleh Togo B putih mengkilat, dan buahnya tidak pecah di pohon. Dengan habitus pohon yang kokoh, Togo-B digunakan dalam program konservasi lahan dan sebagai batang bawah dalam penyediaan bibit kapuk secara okulasi. Dengan habitus pohon yang kokoh, Togo-B digunakan dalam program konservasi lahan dan sebagai batang bawah dalam penyediaan bibit kapuk secara okulasi. \r\n', '2007', 'Karibea ', '2.500 Gelondong/pohon/tahun ', '4.12 kg/100 Gelondong ', '0.76 kg/100 Gelondong ', '29.33% ', 'Putih, panjang ', 'Dengan habitus pohon yang kokoh, Togo-B digunakan dalam program konservasi lahan dan sebagai batang bawah dalam penyediaan bibit kapuk secara okulasi.', 'Komersial', 'Marjani, Moch. Sahid, dan Hadi Sudarmo', 'Balai Penelitian Tanaman Pemanis dan Serat', );
INSERT INTO `kapuk` (`ID_KAPUK`, `ID_DESKRIPSI_UMUM`, `NAMA_KAPUK`, `DESKRIPSI_KAPUK`, `TAHUN_PELEPASAN`, `TIPE_PERTUMBUHAN`, `PRODUKTIVITAS`, `BERAT_GELONDONG`, `KANDUNGAN_SERAT`, `KADAR_MINYAK_BIJI`, `WARNA_SERAT`, `PENJELASAN`, `STATUS`, `PENELITI`, `INSTANSI`, `GAMBAR`) VALUES
(9, 3, 'LC31', 'Persilangan klon Lanang x Congo yang dilakukan pada sekitar tahun 1920-an dilanjutkan dengan penanaman benih hasil persilangan dan evaluasi klon hibrida. Di antara klon-klon hibrida yang diseleksi, maka terpilihlah individu nomor 31 yang menunjukkan keunggulan dibandingkan klon hibrida lainnya dan klon terpilih tersebut mulai diperbanyak dan ditanam oleh manajemen perkebunan pada saat itu. Keunikan varietas kapuk LC 31 adalah pembentukan cabang pertama yang rendah antara 20 cm-100 cm diatas permukaan tanah.', '2009', 'Karibea ', '2000-3000 gelondong/pohon/tahun ', '6.70 kg/100 gelondong ', '23.06% ', '20.36% ', 'putih mengkilat \r\n', 'Hasil seratnya yang berwarna putih mengkilat dan sesuai dengan kualitas â€œJava Kapokâ€ ini sangat disukai petani dan eksportir. \r\n\r\nVarietas ini merupakan pepohonan besar dengan posisi cabang pertama rendah (50-100 ', 'Komersial', 'Emy Sulistyowati dan Deciyanto Soetopo', 'Balai Penelitian Tanaman Tembakau dan Serat\r\n', );

