(1, 4, 'Karangploso 11 (KR 11)', 'Meskipun kenaf termasuk tanaman hari pendek, namun Balittas telah menghasilkan va-rietas unggul yang kurang peka terhadap fotoperiode yaitu KR 11, sehingga varietas KR 11 ini dapat ditanam kapan saja dengan syarat kebutuhan air terpenuhi selama masa pertumbuhan-nya. KR 11 merupakan hasil persilangan Hc 48 x Hc G4 pada tahun 1985. Varietas ini dilepas pada tahun 2001 oleh Menteri Pertanian dengan Surat Keputusan No. 111/Kpts/TP.240/2/2001, tanggal 8 Februari 2001.', 'Berduri sedikit', 'Hijau', 'Rudimenter (siwilan)banyak', 'Menjari', '87-95 hari', 'Kuning krem', '130-140 hari (mumur panjang)', '278-420 cm', '1,60-3,20 cm', '2,75-4,20 ton/ha', '23,66-26,24 gram', '260-376 cm', '24,46-29,60 g/tex', '5,5-6,5%', );
INSERT INTO `kenaf` (`ID_KENAF`, `ID_DESKRIPSI_UMUM`, `NAMA_KENAF`, `DESKRIPSI_KENAF`, `PERMUKAAN_BATANG`, `WARNA_BATANG`, `PERCABANGAN`, `BENTUK_DAUN`, `UMUM_BERBUNGA`, `WARNA_BUNGA`, `UMUR_PANEN`, `TINGGI_TANAMAN`, `DIAMETER_BATANG`, `POTENSI_HASIL`, `BERAT_100BIJI`, `PANJANG_SERAT`, `KEKUATAN_SERAT`, `PERSENTASE_SERAT`, `GAMBAR`) VALUES
(2, 4, 'Karangploso 14 (KR 14)', 'Untuk dapat meningkatkan daya saing kenaf, maka pengembangan kenaf di Indonesia diarahkan ke lahan yang kurang potensial, salah satunya adalah di lahan podsolik merah kuning (PMK). Lahan PMK umumnya berupa lahan kering yang memiliki sifat antara lain: pH rendah, kahat unsur hara, dan kandungan Al dan Fe tinggi. Lahan PMK di Kalimantan tersedia cukup luas yang berpotensi untuk pengembangan kenaf. Pemberdayaan lahan PMK di Kalimantan untuk pengembangan kenaf di samping memenuhi serat kenaf dalam negeri juga akan ber-dampak pada peningkatan pendapatan petani dan pendapatan asli daerah. Untuk mendukung pengembangan kenaf di lahan PMK Balittas telah menghasilkan dua varietas unggul yang telah dilepas berdasarkan SK. Mentan No. 133/Kpts/SR.120/2/2007 dan 134/Kpts/SR.120/2/2007 sebagai varietas unggul baru dengan nama Karangploso 14 (KR 14) dan Karangploso 15 (KR 15).', 'Berduri sedikit', 'Hijau sedikit kemerahan', 'Rudimenter ', 'Menjari bertoreh dalam', '75-90 hari', 'Kuning krem', '120-140 hari ', '270-425 cm', '1,60-3,10 cm', '2,75-4,50 ton/ha', '22,10-26,30 gram', '260-375 cm', '22,19-28,89 g/tex', '5-7%\r\n', );
