(3, 4, 'Karangploso 15 (KR 15)', 'Untuk dapat meningkatkan daya saing kenaf, maka pengembangan kenaf di Indonesia diarahkan ke lahan yang kurang potensial, salah satunya adalah di lahan podsolik merah kuning (PMK). Lahan PMK umumnya berupa lahan kering yang memiliki sifat antara lain: pH rendah, kahat unsur hara, dan kandungan Al dan Fe tinggi. Lahan PMK di Kalimantan tersedia cukup luas yang berpotensi untuk pengembangan kenaf. Pemberdayaan lahan PMK di Kalimantan untuk pengembangan kenaf di samping memenuhi serat kenaf dalam negeri juga akan ber-dampak pada peningkatan pendapatan petani dan pendapatan asli daerah. Untuk mendukung pengembangan kenaf di lahan PMK Balittas telah menghasilkan dua varietas unggul yang telah dilepas berdasarkan SK. Mentan No. 133/Kpts/SR.120/2/2007 dan 134/Kpts/SR.120/2/2007 sebagai varietas unggul baru dengan nama Karangploso 14 (KR 14) dan Karangploso 15 (KR 15).', 'Berduri sedikit', 'Hijau ', 'Rudimenter (siwilan) banyak ', 'Menjari bertoreh dalam', '75-85 hari', 'Kuning krem', '120-130 hari ', '265-415 cm', '1,50-3,00 cm', '2,5-4,5 ton/ha', '21,16-26,50 gram', '255-370 cm', '22,96-29,36 g/tex', '5-7%\r\n', );

