(1, 5, 'Ramindo 1', 'Rami semula dikembangkan di daerah dataran tinggi walaupun sebenarnya rami juga da-pat dikembangkan di dataran rendah terutama yang memiliki fasilitas pengairan. Kendala pe-ngembangan rami adalah panjangnya rantai proses penyeratan sampai menjadi serat siap pin-tal. Proses yang panjang ini menyebabkan rami bukan sebagai cash crop, walaupun harga se-rat rami lebih tinggi dari harga serat kapas. Sebagai salah satu penghasil serat alami, rami me-rupakan komoditas yang perlu dikembangkan. Komoditas ini, selain menghasilkan serat alami yang bermutu tinggi, juga mempunyai hasil samping yang bernilai ekonomi, seperti kompos limbah dekortikasi dan daun rami untuk campuran pakan ternak. Varietas baru Ramindo 1, dengan nama lama Pujon 10, sudah sejak lama dikembangkan petani/pengusaha dan sudah terbukti keunggulannya baik di masyarakat maupun hasil peneli-tian. Ramindo 1 memberikan produktivitas serat yang tinggi (2â€“2,7 ton/ha/tahun) dengan kuali-tas serat yang cukup baik, serta memiliki daya adaptasi yang luas, sehingga klon ini sesuai untuk dikembangkan di dataran rendah, sedang hingga tinggi. Limbah dekortikasi (penyeratan) dapat diolah menjadi pupuk organik yang sangat halus dengan kandungan: Organik 20,13%; N total 2,15%; C/N ratio 3,01%; bahan organik 34,83%; P2O5 1,47%; K2O 2,76%; CaO 3,73%; MgO 2,22%; S 0,13%; dan KTK 65,56 me/100 g pupuk organik. Teknik pengomposan dapat dilakukan secara sederhana, yaitu dengan mencampurkan dedak, sedikit gula pasir, EM-4, dan disiram air secukupnya. Selain itu, sisa dekortikasi banyak mengandung kayu, dan seratnya baik untuk bahan baku pulp/kertas. Daun rami (40% dari bobot brangkasan segar) mengandung protein sekitar 24%, sangat baik untuk sumber protein ternak dan unggas. Setelah diproses menjadi tepung dapat diman-faatkan untuk campuran konsentrat berbagai pakan ternak. Pakan ternak dari daun rami me-ngandung sekitar: 10% air; 1,05â€“1,75% lisin; 0,14â€“0,73% methionin; dan 0,18â€“0,31% tripto-phan. Selain itu mengandung karotin (provitamin A) dan riboflavin (vitamin B2) masing-masing 13,3 dan 0,74 mg tiap 100 g bahan keringnya. Penggunaan varietas unggul Ramindo 1 dengan pemberian paket pupuk lengkap (orga-nik, N, P, K dan ZPT+ PPC) dapat meningkatkan hasil serat sampai dengan 58â€“60%.\r\n', 'Pujon, Malang', 'Semi determinate', 'Hijau', 'Hijau', 'Merah', 'Cordate (jantung)', 'Hijau', 'Merah muda', '20-30 hari ', '190-255 cm', '11-13 mm', '12-17', '2 bulan', '4-5 gram', '2-2,7 ton', '3-4%', 'baik', 'Dataran rendah - tinggi, dan lahan gambut', );

